import { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './card-list.component.css';

class CardList extends Component {
    render() {
        const { monsters, searchString } = this.props;
        const fileteredMonsters = monsters.filter((monster) => {
            return monster.name.toLocaleLowerCase().includes(searchString);
        });
        return (
            <div className="container">
                {fileteredMonsters.map(monster =>
                    <div className='card-container' key={monster.id}>
                        <img alt={`monster ${monster.name}`} src={`https://robohash.org/${monster.name}/set=set2&size=180*180`}/>
                        <h4>{monster.name}</h4>
                        <p>{monster.email}</p>
                    </div>
                )}
            </div>

        );
    }
}
export default CardList;
